  getValidation = function () {
    return axios({
      url: `${this.host}/users/xWx`,
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      method: "GET",
    });
  };

  getTriggerTimes = function () {
    return axios({
      url: `${this.host}/cron/triggerTimes`,
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      method: "GET",
    });
  };

  getCronInfo = function (cron) {
    return axios({
      url: `${this.host}/cron/info`,
      headers: {
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
        "Content-Type": "application/json",
      },
      method: "POST",
      data: JSON.stringify({
        cron: cron,
      }),
    });
  };

  addNewEntry = function (request) {
    return axios({
      url: `${this.host}/cron/insert`,
      headers: {
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
        "Content-Type": "application/json",
      },
      method: "POST",
      data: JSON.stringify({
        details: request,
      }),
    });
  };
}
